import React from "react";
import JoinPromiseButton from "./JoinPromiseButton.js";

export default function TableOfPromises({
  joinablePromises,
  assetAName,
  assetBName,
  assetADeclimals,
  assetBDeclimals,
}) {
  function producePromises() {
    if (joinablePromises) {
      return joinablePromises.map((promise) => (
        <tr>
          <td>{promise._amountA / Math.pow(10, assetADeclimals)}</td>
          <td>{promise._amountB / Math.pow(10, assetBDeclimals)}</td>
          <td>{promise._time}</td>
          <td>
            <JoinPromiseButton />
          </td>
        </tr>
      ));
    } else {
      return (
        <div>
          <p>none</p>
        </div>
      );
    }
  }
  return (
    <div>
      <p>Promises you can join</p>
      <table>
        <tr>
          <th>{assetAName}</th>
          <th>{assetBName}</th>
          <th>Time</th>
          <th></th>
        </tr>
        {producePromises()}
      </table>
    </div>
  );
}
